import React from "react";
import "../styles/Skills.css";

export default function Skills() {
  // Skill list with names and proficiency
  const skills = [
    { name: "HTML", percent: 90 },
    { name: "CSS", percent: 85 },
    { name: "JavaScript", percent: 80 },
    { name: "React JS", percent: 75 },
    { name: "Java", percent: 80 },
    { name: "JDBC", percent: 70 },
    { name: "Servlet & JSP", percent: 70 },
    { name: "Oracle SQL & PL/SQL", percent: 75 },
    { name: "PHP", percent: 65 },
    { name: "C#", percent: 60 },
    { name: "ASP.NET", percent: 60 },
    { name: "jQuery", percent: 70 },
  ];

  return (
    <section id="skills" className="skills-section">
      <h2 className="section-title">ðŸ’» My Skills</h2>
      <div className="skills-container">
        {skills.map((skill, index) => (
          <div key={index} className="skill">
            <div className="skill-header">
              <span>{skill.name}</span>
              <span>{skill.percent}%</span>
            </div>
            <div className="skill-bar">
              <div
                className="skill-progress"
                style={{ width: `${skill.percent}%` }}
              ></div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
